import firestore = FirebaseFirestore
import CollectionReference = firestore.CollectionReference
import FieldPath = firestore.FieldPath
import DocumentData = firestore.DocumentData
import WhereFilterOp = firestore.WhereFilterOp
export const doc = (collection: CollectionReference) => (documentPath: string | void) => documentPath ? collection.doc(documentPath) : collection.doc(); // we force a string for documentPath
export const add = (collection: CollectionReference) => (data: DocumentData) => collection.add(data); // we force a string for documentPath
export const where = (collection: CollectionReference) => (fieldPath: string|FieldPath, opStr: WhereFilterOp, value: any) => collection.where(fieldPath, opStr, value);
export const limit = (collection: CollectionReference) => (limit: number) => collection.limit(limit);
export const startAt = (collection: CollectionReference) => (...fieldValues: any[]) => collection.startAt(...fieldValues);
export const startAfter = (collection: CollectionReference) => (...fieldValues: any[]) => collection.startAfter(...fieldValues);
export const endAt = (collection: CollectionReference) => (...fieldValues: any[]) => collection.endAt(...fieldValues);
export const endBefore = (collection: CollectionReference) => (...fieldValues: any[]) => collection.endBefore(...fieldValues);

export default doc;
